import React from 'react';
import BaseLayout from '../components/layouts/BaseLayout'


class About extends React.Component {
    render() {
        return (
            <BaseLayout>
               <h1> This page is about Me! </h1>
            </BaseLayout>
        )
    }
}
export default About;
